import { Container, Row, Col } from "react-bootstrap";

const Login = () => {
  return (
    <>
      <Container className="ml-auto">
        <Row>
          <Col>Text1 </Col>
          <Col>
          <Form>
                  <FormGroup>
                      <Form.Control type="email" placeholder="Your email..."/>
                  </FormGroup>
                  <FormGroup>
                      <Form.Control type="password" placeholder="Your password..."/>
                  </FormGroup>
              </Form>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Login;
